{"cells":[{"source":"<a href=\"https://www.kaggle.com/code/sofiadriana/fitbit-data-analysis?scriptVersionId=149225273\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown"},{"cell_type":"markdown","id":"f61e6f08","metadata":{"papermill":{"duration":0.006774,"end_time":"2023-11-03T23:17:39.836359","exception":false,"start_time":"2023-11-03T23:17:39.829585","status":"completed"},"tags":[]},"source":["# About the Company\n","Bellabeat is a high-tech manufacturer of health-focused products for women. Bellabeat is a successful small company, but they have the potential to become a larger player in the global smart device market. Urška Sršen, cofounder and Chief Creative Officer of Bellabeat, believes that analyzing smart device fitness data could help unlock new growth opportunities for the company. I have been asked to focus on one of Bellabeat’s products and analyze smart device data to gain insight into how consumers are using their smart devices. The insights I discover will then help guide marketing strategy for the company."]},{"cell_type":"markdown","id":"96742770","metadata":{"papermill":{"duration":0.004836,"end_time":"2023-11-03T23:17:39.846761","exception":false,"start_time":"2023-11-03T23:17:39.841925","status":"completed"},"tags":[]},"source":["I chose to focus on improving the **Bellabeat app**. The Bellabeat app provides users with health data related to their **activity**, **sleep**, stress, menstrual cycle, and mindfulness habits. This data can help users better understand their current habits and *make healthy decisions*. The Bellabeat app connects to their line of smart wellness products.\n","\n","Using data from FitBit users, I will analyze it to draw conclusions about how people use these smart devices and recommend improvements for BellaBeat."]},{"cell_type":"markdown","id":"c4275dd9","metadata":{"papermill":{"duration":0.