oLADAAAAEAgUdgAAAAACgcIOAAAAQCBQ\n2AEAAAAIBAo7AAAAAIH4f65LXkqYNnrYAAAAAElFTkSuQmCC"},"metadata":{"image/png":{"height":420,"width":420}},"output_type":"display_data"}],"source":["ggplot(data = totalactivity, aes(x=SedentaryMinutes, y=TotalHoursAsleep)) + \n","  geom_point() + labs(title=\"Total Steps vs. Calories\")"]},{"cell_type":"markdown","id":"e7c71edf","metadata":{"papermill":{"duration":0.013161,"end_time":"2023-11-03T23:17:56.728782","exception":false,"start_time":"2023-11-03T23:17:56.715621","status":"completed"},"tags":[]},"source":["This graph demonstrates a negative correlation between sedentary minutes and total hours asleep. The more that a user is sedentary, the fewer hours they sleep."]},{"cell_type":"markdown","id":"cb446e84","metadata":{"papermill":{"duration":0.013252,"end_time":"2023-11-03T23:17:56.755217","exception":false,"start_time":"2023-11-03T23:17:56.741965","status":"completed"},"tags":[]},"source":["## Recommendations\n","Based on my analysis of the data provided, I have a few recommendation for BellaBeat. Specifically, for how these trends can inform Bellabeat marketing strategy.\n","\n","* The summary statistics revealed the average number of hours asleep is only 6.99. On top of this, sleeping fewer hours was associated with increased sedentary minutes.\n","\n","In order to encourage users to sleep at least 8 hours, the app should emphasize sleep by creating a tab dedicated to sleep. This tab should providing tips for sleep hygiene, the importance of sleep, as well as automated alerts when it is time to sleep and wake up.\n","\n","* Higher sedentary minutes and sleeping too many hours (>10 hours) was also associated with taking fewer steps. \n","\n","Therefore, the BellaBeat app could have an option for users to set a goal for daily steps (at least 10,000) to incentivize and make users aware of the benefits of taking more steps. They should also inform users that a healthy sleeping range is vital to being more active. \n"]},{"cell_type":"markdown","id":"6d59abd2","metadata":{"papermill":{"duration":0.013093,"end_time":"2023-11-03T23:17:56.781357","exception":false,"start_time":"2023-11-03T23:17:56.768264","status":"completed"},"tags":[]},"source":["### Note\n","In order to draw further conclusions, more data would be needed. Specifically data on weight, stress, and mindfulness is necessary to provide recommendations for the app in these areas. "]}],"metadata":{"kernelspec":{"display_name":"R","language":"R","name":"ir"},"language_info":{"codemirror_mode":"r","file_extension":".r","mimetype":"text/x-r-source","name":"R","pygments_lexer":"r","version":"4.0.5"},"papermill":{"default_parameters":{},"duration":20.300887,"end_time":"2023-11-03T23:17:56.921575","environment_variables":{},"exception":null,"input_path":"__notebook__.ipynb","output_path":"__notebook__.ipynb","parameters":{},"start_time":"2023-11-03T23:17:36.620688","version":"2.4.0"}},"nbformat":4,"nbformat_minor":5}